जेनजी आन्दोलनका क्रममा कोशी प्रदेशमा ज्यान गुमाएका १० मध्ये पाँच जनाको सनाखत गएको प्रहरीले जनाएको छ । त्यसमध्ये पाँचको सनाखत हुन सकेको छैन । पाँच जनाको कोही पनि आफन्त सम्पर्कमा नआउँदा सनाखत हुन नसकेको प्रहरीले जनाएको छ । भदौ २३ र २४ गते भएको आन्दोलनमा कोशी प्रदेशमा १० जनाको ज्यान गएको थियो ।

कोशी प्रदेश प्रहरी कार्यालयका प्रवक्ता तथा प्रहरी वरिष्ठ उपरीक्षक दीपक पोखरेलका अनुसार हालसम्म झापाको बिर्तामोडमा मृत्यु हुने ३ जना र सुनसरीको इटहरीमा मृत्यु हुने २ जनाको सनाखत भएको हो ।&amp;nbsp;

